import { createApp } from 'vue'
import VueRouter from 'vue-router';
import App from './App.vue'
import GamePage from './pages/start_game.vue';

Vue.use(VueRouter);

const routes = [
  { path: '/', component: App },
  { path: '/game', component: GamePage }
];

const router = new VueRouter({
  routes
});

const app = createApp(App);
app.use(router);
app.mount('#app');
